import Photos from "../../../assets/Photos.jsx";

const car_list = [
    {
        img: Photos.photo.t_2_5,
        title: "До 2.5 тонн",
    },
    {
        img: Photos.photo.t_5,
        title: "До 5 тонн",
    },
    {
        img: Photos.photo.t_10,
        title: "До 10 тонн",
    },
    {
        img: Photos.photo.t_22,
        title: "До 22 тонн",
    },
    {
        img: Photos.photo.grain_carriers,
        title: "Зерновози та самоскиди",
    }
];

export default car_list;
